  \"2015-02-26T17:08:22.124925\",\n\t\"name\": \"rental-housing-finance-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the RHFS is to provide current
  and continuous measure of the financial health and property characteristics of single-family
  and multifamily rental housing properties in the United States.  The survey provides
  information on the financing of single-family and multifamily rental housing properties
  with emphasis on new originations for purchase, refinancing, and loan terms associated
  with these originations. In addition, the survey includes information on property
  characteristics, such as number of units, amenities available, rental income and
  expenditure information.  This survey was conducted in 2012 and will be conducted
  in 2015.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
